import React from "react";
import styled from "styled-components";
import SimpleSlider from "./PhotoSlider/SimpleSlider";

const Conteiner = styled.div`
  background-color: red;
  height: 561px;
  display: block;
`;

const SimpleSliderConteiner = styled.div`
  overflow: hidden;
  margin-top: 32px;
  margin-left: 33px;
  width: 279px;
  height: 495px;
  border-radius: 8.11px;
  @media (max-width: 768px) {
    max-height: 400px;
    margin: 20vw auto;
    width: 100%;
  }
`;
export default function PersonPage() {
  return (
    <Conteiner>
      <SimpleSliderConteiner>
        <SimpleSlider />
      </SimpleSliderConteiner>
    </Conteiner>
  );
}
